	(373, 'Produk', '16', 'Update', '2024-07-26 03:23:32', '1', '{"id":16,"user_id":"42","nama_produk":"180 Worksheet Printable Seri Alfabet","slug":"180-worksheet-printable-seri-alfabet","kategori_produk_id":9,"harga_beli":null,"harga_jual":15000,"deskripsi":"Produk Digital Worksheet Printable adalah media pembelajaran anak yang inovatif dan efektif. Produk ini dapat dicetak berulang kali kapan saja dan di mana saja. Produk ini berisi berbagai materi pembelajaran yang bermanfaat bagi perkembangan anak.Materi pembelajaran yang terdapat pada produk ini meliputi belajar alfabet, mencari alfabet, mewarnai, menjodohkan, tracing bergaris, dan masih banyak lagi. Belajar alfabet dapat membantu anak memahami huruf dan memperluas kosakata mereka. Mencari alfabet dapat membantu anak mengembangkan kemampuan pengamatan dan konsentrasi. Mewarnai dapat membantu anak mengembangkan kreativitas dan keterampilan motorik halus. Menjodohkan dapat membantu anak mengembangkan kemampuan pemecahan masalah dan konsentrasi. Tracing bergaris dapat membantu anak mengembangkan keterampilan motorik halus dan konsentrasi.Keuntungan dari 193 lembar produk ini adalah dapat digunakan berulang kali dan dicetak kapan saja dan di mana saja. Produk ini sangat cocok untuk orang tua yang ingin memberikan pembelajaran yang bermanfaat bagi anak mereka di rumah. Dengan menggunakan produk ini, anak-anak dapat belajar sambil bermain dan mengembangkan keterampilan mereka secara efektif. Produk ini juga dapat membantu orang tua dalam mengajar anak-anak mereka dengan cara yang menyenangkan dan interaktif.","stok":null,"gambar":"20240707114035_IMG-20240707-WA0016.webp","youtube":null,"status":"Aktif","status_diskon":null,"urutan":null,"harga_jual_diskon":null,"created_at":"2024-07-07T11:40:35.000000Z","updated_at":"2024-07-07T11:56:36.000000Z"}', '{"_method":"PUT","_token":"7kSgDXmVghNsPwtzY70TRTcdfwnUl6R5f1xtn9wE","id":"16","user_id":"42","nama_produk":"180 Worksheet Printable Seri Alfabet","slug":"180-worksheet-pri